void TestMCMESHTRAN_Basic::TestMCNPFmeshOrthogonize()
{
    vector <MCNPFmesh> MeshTallies;
    MCNPFmeshReader aReader ;

    //test reading meshtal
    aReader.ReadMeshConfig("./MCNPFmesh/2.1MT+RZT+0E+DF+WOFM+N", MeshTallies);
    aReader.ReadMeshtal("./MCNPFmesh/2.1MT+RZT+0E+DF+WOFM+N.msh", MeshTallies);
    CPPUNIT_ASSERT (MeshTallies.size() == 1);
    MCNPFmesh * meshtal = &MeshTallies[0];
    //first check
    meshtal->Ort [0] = 0.00;
    meshtal->Ort [1] = 0.00;
    meshtal->Ort [2] = 0.00;
    aReader.Orthogonalize(*meshtal);
    //after orthogonalize, the Ort should be 0,1,0 in this case
    CPPUNIT_ASSERT_EQUAL(0.00, meshtal->Ort [0]);
    CPPUNIT_ASSERT_EQUAL(1.00, meshtal->Ort [1]);
    CPPUNIT_ASSERT_EQUAL(0.00, meshtal->Ort [2]);

    //given two vectors Axs =(1,1,1) Vec=(1,1,2)
    //after orthogonalized and normalized, the three vectors should be:
    //Axs =(0.57735027,0.57735027,0.57735027 ), Vec= (-0.40824829, -0.40824829, 0.81649658), Ort =(0.70710678, -0.70710678, 0)
    meshtal->Axs[0] = 1;
    meshtal->Axs[1] = 1;
    meshtal->Axs[2] = 1;
    meshtal->Vec[0] = 1;
    meshtal->Vec[1] = 1;
    meshtal->Vec[2] = 2;
    aReader.Orthogonalize(*meshtal);
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0.57735027,meshtal->Axs[0], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0.57735027,meshtal->Axs[1], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0.57735027,meshtal->Axs[2], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (-0.40824829,meshtal->Vec[0], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (-0.40824829,meshtal->Vec[1], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0.81649658,meshtal->Vec[2], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0.70710678,meshtal->Ort[0], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (-0.70710678,meshtal->Ort[1], 1e-6 );
    CPPUNIT_ASSERT_DOUBLES_EQUAL (0,meshtal->Ort[2], 1e-6 );

}

