void TestMCMESHTRAN_Basic::TestMCNPFmeshReadXYZmore()
{
    vector <MCNPFmesh> MeshTallies;
    MCNPFmeshReader aReader ;
    //test reading meshtal
    aReader.ReadMeshConfig("./MCNPFmesh/3.NMT+XYZ+E", MeshTallies);
    aReader.ReadMeshtal("./MCNPFmesh/3.NMT+XYZ+E.msh", MeshTallies);
    CPPUNIT_ASSERT (MeshTallies.size() == 4);
    MCNPFmesh * meshtalA = &MeshTallies[0];
    MCNPFmesh * meshtalB = &MeshTallies[1];
    MCNPFmesh * meshtalC = &MeshTallies[2];
    MCNPFmesh * meshtalD = &MeshTallies[3];

    //test if result are equal amoung different ouptut format
    for (int k=0; k<meshtalA->CoordinateK.size()-1; k++) {
        for (int j=0; j<meshtalA->CoordinateJ.size()-1; j++) {
            for (int i=0; i<meshtalA->CoordinateI.size()-1; i++) {
                //strictly equal
                CPPUNIT_ASSERT (meshtalA->getOneTallyResult(i, j, k) == meshtalB->getOneTallyResult(i, j, k) );
                CPPUNIT_ASSERT (meshtalB->getOneTallyResult(i, j, k) == meshtalC->getOneTallyResult(i, j, k) );
                CPPUNIT_ASSERT (meshtalC->getOneTallyResult(i, j, k) == meshtalD->getOneTallyResult(i, j, k) );
                CPPUNIT_ASSERT (meshtalD->getOneTallyResult(i, j, k) == meshtalA->getOneTallyResult(i, j, k) );
            }
        }
    }
}

