void TestMCMESHTRAN_Basic::TestMCNPUmeshReader1()
{
    MCMESHTRAN_MCNPUMeshReader aUMeshReader ;
    aUMeshReader.setKeepInstances(true);
    aUMeshReader.setRemoveMultiplier(false);
    aUMeshReader.load_file("./MCNPFmesh/1_tet_noed.eeout");
    vector < const MEDCouplingFieldDouble * > aTestFieldList = aUMeshReader.getFieldList();
    CPPUNIT_ASSERT(aTestFieldList.size() == 3);
    const MEDCouplingFieldDouble * aTestField = aTestFieldList[0];
    MEDCouplingUMesh * aTestMesh = dynamic_cast <MEDCouplingUMesh *> (const_cast <MEDCouplingMesh *> (aTestField->getMesh()));
    CPPUNIT_ASSERT_EQUAL(1270, aTestMesh->getNumberOfNodes());
    CPPUNIT_ASSERT_EQUAL(3983, aTestMesh->getNumberOfCells());
    CPPUNIT_ASSERT_EQUAL(1270, aTestMesh->getCoordinatesAndOwner()->getNumberOfTuples());
    CPPUNIT_ASSERT_EQUAL(3, aTestField->getArray()->getNumberOfComponents());
    vector <double > aTestVec;
    //test node
    aTestVec.resize(3); //x, y, z
    aTestMesh->getCoordinatesAndOwner()->getTuple(0,aTestVec.data());
    cout <<endl<< "first node:"<<endl;
    for (int i=0; i<aTestVec.size(); i++) cout <<aTestVec[i]<<"\t";
    CPPUNIT_ASSERT_DOUBLES_EQUAL(2000, aTestVec[0], 1e-6);
    CPPUNIT_ASSERT_DOUBLES_EQUAL(0, aTestVec[1], 1e-6);
    CPPUNIT_ASSERT_DOUBLES_EQUAL(1500, aTestVec[2], 1e-6);

    aTestMesh->getCoordinatesAndOwner()->getTuple(aTestMesh->getCoordinatesAndOwner()->getNumberOfTuples()-1
                                                  ,aTestVec.data());
    cout <<endl<< "last node:"<<aTestMesh->getCoordinatesAndOwner()->getNumberOfTuples()<<endl;
    for (int i=0; i<aTestVec.size(); i++) cout <<aTestVec[i]<<"\t";
    CPPUNIT_ASSERT_DOUBLES_EQUAL(1700.01, aTestVec[0], 1e-6);
    CPPUNIT_ASSERT_DOUBLES_EQUAL(1407.24, aTestVec[1], 1e-6);
    CPPUNIT_ASSERT_DOUBLES_EQUAL(-243.56, aTestVec[2], 1e-6);

    //test conn
    vector <int > bTestVec;
    bTestVec.resize(5);
    int begin, end;
//    int begin = * aTestMesh->getNodalConnectivityIndex()->getTuple(aTestMesh->getNodalConnectivityIndex()->getNumberOfTuples()-2, &begin);
    aTestMesh->getNodalConnectivityIndex()->getTuple(aTestMesh->getNodalConnectivityIndex()->getNumberOfTuples()-2, &begin);
//    int end  = * aTestMesh->getNodalConnectivityIndex()->getPointer()+(aTestMesh->getNodalConnectivityIndex()->getNumberOfTuples()-1);
    aTestMesh->getNodalConnectivityIndex()->getTuple(aTestMesh->getNodalConnectivityIndex()->getNumberOfTuples()-1, &end);
    cout <<"begin : "<<begin<< "\t end: "<<end <<endl;

    copy(aTestMesh->getNodalConnectivity()->getPointer()+begin,
         aTestMesh->getNodalConnectivity()->getPointer()+end,
         bTestVec.data());
    cout <<endl<< "last element conn:"<<endl;
    for (int i=0; i<bTestVec.size(); i++) cout <<bTestVec[i]<<"\t";
    CPPUNIT_ASSERT_EQUAL(14, bTestVec[0]);
    CPPUNIT_ASSERT_EQUAL(1060, bTestVec[1]);
    CPPUNIT_ASSERT_EQUAL(1203, bTestVec[2]);
    CPPUNIT_ASSERT_EQUAL(1256, bTestVec[3]);
    CPPUNIT_ASSERT_EQUAL(1235, bTestVec[4]);

    //test field
    aTestField->getArray()->getTuple(0, aTestVec.data());
    cout <<endl<< "the first field component:"<<endl;
    for (int i=0; i<aTestVec.size(); i++) cout <<aTestVec[i]<<"\t";




}



















